import { BrowserRouter as Route, Router } from "react-router-dom";
import "./App.css";
import Post from "./components/pages/post";

function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/post" component={Post} />
      </Router>
    </div>
  );
}

export default App;
